// counter.js
const Counter = (state = { value: 0 }, action) => {
    switch (action.type) {
        case 'counter/increment':
            return { value: state.value + 1 };
        case 'counter/decrement':
            return { value: state.value - 1 };
        default:
            return state;
    }
};

export default Counter;  // Export par défaut
